import React from 'react';
import { Container, Row, Col, Dropdown } from 'react-bootstrap';
import { GoSearch } from 'react-icons/all';

const AddStep = () => {

  return (
    <div className="add-step-wrap">
      <div className="user-search">
        <div className="add-step-box px-3">
          <span><GoSearch /></span>
          <input className="user-search-input" type="text" placeholder="이름,조직,역할을 검색해보세요." />
        </div>
      </div>

      <div>
        <div className="user-lists">
          <div type="button" className="d-flex align-items-center px-3 pt-2 pb-2">
            <div className="user-thumb"><span className="user-thumb-text">호정</span></div>
            <div className="user-name">안호정</div>
            <div className="user-job">
              <span>개발팀</span>
              <span>·</span>
              <span>연구원</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AddStep;
